INSERT INTO `v1_0b463b0571df6359c808a55144f734fbdc318b9965ed09c87d824cfd000a164c` VALUES ("ヤマト", "2024/10/31 12:00:00", 0.0, 130011, 3001, 100, "2030/01/01 14:59:59", "ミッションねえ……\nちょうどいいや\nどこまで片付けられるか\n賭けをしようじゃないか", 3001100, 1, -416.5, 2, 2.1);
INSERT INTO `v1_0b463b0571df6359c808a55144f734fbdc318b9965ed09c87d824cfd000a164c` VALUES ("ヤマト", "2024/10/31 12:00:00", 0.0, 130011, 3001, 101, "2030/01/01 14:59:59", "他人から言われた任務を\n言われるままにやるなんざ\n性に合わないんだがね……\nま、報酬は貰っとこうか", 3001101, 4, -416.5, 2, 5.68);
INSERT INTO `v1_0b463b0571df6359c808a55144f734fbdc318b9965ed09c87d824cfd000a164c` VALUES ("ヤマト", "2024/10/31 12:00:00", 0.0, 130011, 3001, 102, "2030/01/01 14:59:59", "なんだい？　やれンなら\nとっとと済ませちまいな。\nフブキが早くやることやれ\nってボヤいてたよ。", 3001102, 1, -416.5, 1, 0.0);
INSERT INTO `v1_0b463b0571df6359c808a55144f734fbdc318b9965ed09c87d824cfd000a164c` VALUES ("フブキ", "2024/10/31 12:00:00", 0.0, 130211, 3002, 100, "2030/01/01 14:59:59", "え～？　ぼくに頼みごと～？\nどうしちゃおっかな～\nちゃんとお願いできたら\n考えてあげよっかな～？", 3002100, 1, -416.5, 1, 0.0);
INSERT INTO `v1_0b463b0571df6359c808a55144f734fbdc318b9965ed09c87d824cfd000a164c` VALUES ("フブキ", "2024/10/31 12:00:00", 0.0, 130211, 3002, 101, "2030/01/01 14:59:59", "ほらほらぁ、これが\n欲しいんでしょ～？\nほんと、しょうがないよね～\nザコおに～いさん♡", 3002101, 1, -416.5, 1, 0.0);
INSERT INTO `v1_0b463b0571df6359c808a55144f734fbdc318b9965ed09c87d824cfd000a164c` VALUES ("フブキ", "2024/10/31 12:00:00", 0.0, 130211, 3002, 102, "2030/01/01 14:59:59", "へえ～、欲しいんだ～？\nぼくのた・い・せ・つ・な・モ・ノ\nあははっ！　なに考えてんの？\nもうへんふしじゃ～んｗ", 3002102, 5, -416.5, 2, 8.53);
INSERT INTO `v1_0b463b0571df6359c808a55144f734fbdc318b9965ed09c87d824cfd000a164c` VALUES ("フブキ", "2024/10/31 12:00:00", 0.0, 130211, 3002, 103, "2030/01/01 14:59:59", "なになに～？　もしかしてまた\nおねだりするつもりなんだ？\nとか言って、ほんとはぼくに\n会いたいだけだったりして～？", 3002103, 7, -416.5, 1, 5.67);
INSERT INTO `v1_0b463b0571df6359c808a55144f734fbdc318b9965ed09c87d824cfd000a164c` VALUES ("フブキ", "2024/10/31 12:00:00", 0.0, 130211, 3002, 104, "2030/01/01 14:59:59", "ザコお兄さんってぇ\n頼み方もワンパなのぉ～？\nもっと必死にならないと\nぼくの心は動かせないよ～？", 3002104, 1, -416.5, 1, 0.0);
INSERT INTO `v1_0b463b0571df6359c808a55144f734fbdc318b9965ed09c87d824cfd000a164c` VALUES ("フブキ", "2024/10/31 12:00:00", 0.0, 130211, 3004, 300, "2030/01/01 14:59:59", "あのさーザコお兄さん、\nな～んか調子乗ってない？\nぼくのこと、なんでもくれる\nチョロいやつとか思ってたりー？", 3002300, 3, -416.5, 3, 0.0);
INSERT INTO `v1_0b463b0571df6359c808a55144f734fbdc318b9965ed09c87d824cfd000a164c` VALUES ("フブキ", "2024/10/31 12:00:00", 0.0, 130211, 3005, 301, "2030/01/01 14:59:59", "ざんね～ん♪\nうざいお兄さんには、もうな～んにもあげませ～ん♡\nほんとなっさけなーい♪\nばいば～い♡", 3002400, 7, -416.5, 7, 0.0);
INSERT INTO `v1_0b463b0571df6359c808a55144f734fbdc318b9965ed09c87d824cfd000a164c` VALUES ("フブキ", "2024/10/31 12:00:00", 0.0, 130211, 3003, 200, "2030/01/01 14:59:59", "きゃはは、ほんと必死～♡\nは～、面白かった。\n笑えたからいいよ～\nそれ、恵んだげる～♪", 3003200, 2, -416.5, 1, 4.4);
INSERT INTO `v1_0b463b0571df6359c808a55144f734fbdc318b9965ed09c87d824cfd000a164c` VALUES ("フブキ", "2024/10/31 12:00:00", 0.0, 130211, 3003, 201, "2030/01/01 14:59:59", "は～、しょうがないな～♡\nザコお兄さんってば\nほんとよわよわで\n情けないよね～ｗ", 3003201, 7, -416.5, 7, 0.0);
INSERT INTO `v1_0b463b0571df6359c808a55144f734fbdc318b9965ed09c87d824cfd000a164c` VALUES ("フブキ", "2024/10/31 12:00:00", 0.0, 130211, 3003, 202, "2030/01/01 14:59:59", "お兄さんってば、ぼくがいないと\nほんとザッコザコだよね～\nもっと感謝しろし～♪", 3003202, 1, -416.5, 2, 5.6);
